import React, {useState, useEffect, useCallback, Fragment} from 'react';

import Button from '@atlaskit/button/standard-button';
import { Checkbox } from '@atlaskit/checkbox';
import Modal, {
  ModalBody,
  ModalFooter,
  ModalHeader,
  ModalTitle,
  ModalTransition,
} from '@atlaskit/modal-dialog';
import Select, {
  components,
  OptionProps,
  SingleValueProps,
} from '@atlaskit/select';
import Textfield from '@atlaskit/textfield';
import Form, { CheckboxField, Field } from '@atlaskit/form';
import { useDispatch, useSelector } from 'react-redux';
import { fetchProjects } from '../src/features/projects/projectSlice';

const FormModalDialog = () => {
    const [isOpen, setIsOpen] = useState(false);

    const open = () => setIsOpen(true);
    const close = () => setIsOpen(false);

    const dispatch = useDispatch();
    const project = useSelector(state => state.project);

    useEffect(() => {
      dispatch(fetchProjects());
    }, []);

    const onSubmit = (e) => {
        e.preventDefault();
      };

    return (
      <>
      <Button appearance="primary" onClick={open}>
        Open modal
      </Button>

      <ModalTransition>
        {isOpen && (
          <Modal onClose={close}>
            <form onSubmit={onSubmit}>
              <ModalHeader>
                <ModalTitle>Create a user</ModalTitle>
              </ModalHeader>
              <ModalBody>
                <Field
                  name="icecream"
                  label="Select a flavor"
                  defaultValue={[]}
                >
                  {({ fieldProps: { id, ...rest }, error }) => (
                  <Fragment>
                    <Select inputId={id} {...rest} options={project.projects} />
                  </Fragment>
                  )}
                </Field>
              </ModalBody>
              <ModalFooter>
                <Button appearance="subtle" onClick={close}>
                  Close
                </Button>
                <Button appearance="primary" type="submit">
                  Create
                </Button>
              </ModalFooter>
            </form>
          </Modal>
        )}
      </ModalTransition>
    </>
    );
  };

  export default FormModalDialog;
